Ext.data.JsonP['iOS_Module_Development_Guide']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>iOS Module Development Guide</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p>\n\t\t</div>\n        <div class=\"header\"/>\n\n        <div id=\"src-43288310\" class=\"content\">\n                        <h1>iOS Module Development Guide</h1>\n    <div class=\"section section-2 \" id=\"src-43288310_iOSModuleDevelopmentGuide-Overview\">\n        <h2 class=\"heading \"><span>Overview</span></h2>\n    <p>Titanium provides the ability to extend the built-in functionality of the Titanium SDK through a series of optional extensions called modules. Modules let you write code in a platform&apos;s native language (Objective-C for iOS). Through a series of components, we can expose new functionality to the JavaScript running in the Titanium SDK.    </p>\n    <p>These guides assume you are familiar with native development using the iOS SDK and Xcode.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-43288310_iOSModuleDevelopmentGuide-Chapters\">\n        <h2 class=\"heading \"><span>Chapters</span></h2>\n    <p><strong class=\" \"><a class=\"document-link \" href=\"#!/guide/iOS_Module_Quick_Start\">iOS Module Quick Start</a></strong>    </p>\n    <p>Provides basic information to quickly create, build, package and test modules.    </p>\n    <p><strong class=\" \"><a class=\"document-link \" href=\"#!/guide/iOS_Module_Architecture\">iOS Module Architecture</a></strong>    </p>\n    <p>Provides in-depth information about the class components used to build modules.  Titanium uses a specific notation for each module component.    </p>\n    <p><strong class=\" \"><a class=\"document-link \" href=\"#!/guide/iOS_Module_Project\">iOS Module Project</a></strong>    </p>\n    <p>Provides in-depth information about the structure of a module project as well as using Studio and the CLI to manage the projects.  Also provides information about adding assets and third-party frameworks to the module.    </p>\n    <p><strong class=\" \"><a class=\"external-link external-link\" href=\"http://docs.appcelerator.com/module-apidoc/latest/ios/index.html\" target=\"_blank\">iOS Module API Reference</a></strong>    </p>\n    <p>Useful APIs for module development.  The module components extend the <tt class=\" \">TiModule</tt>, <tt class=\" \">TiProxy</tt>, <tt class=\" \">TiUIView</tt> and <tt class=\" \">TiViewProxy</tt> classes.    </p>\n    <p>    </p>\n    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=43288310\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"iOS Module Development Guide"});